import React, { Component } from 'react';
import './App.css';
import axios from 'axios';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      users: []
    }
  }

  componentDidMount(){
    axios.get('http://localhost:8080/users/')
    .then((res) => {
      console.log(res.data);
    })
    .catch((err) => {
      console.log(err);
    })
  }

  getAllUsers() {
    axios.get('http://localhost:8080/users/')
    .then((res) => {
      this.setState({users: res.data})
    })
    .catch((err) => {
      console.log(err);
    })
  }

  render() {
    return (
      <div className="App">
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
          <a className="navbar-brand" href="/">AXIOS HTTP CLIENT</a>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
        </nav>
        <div className="container" style={{marginTop: '50px'}}>
          <div className="card">
            <div className="card-body">
              <h3 className="text-left">GET ALL USERS</h3>
              <div class="input-group mb-3">
                <input type="text" class="form-control" disabled placeholder="http://localhost:8080/users/" aria-label="Recipient's username" aria-describedby="basic-addon2"/>
                  <button className="btn btn-primary btn-sm" onClick={this.getAllUsers}>GET ALL</button>
              </div>
              {this.state.users.map((user) => {
                return (
                  <div></div>
                )
              })}
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
